import "./Checkout.css";
function Checkout() {
    return (
        <div className="checkout">
            <div className="checkout_left">
                <img className="checkout_ad" src="checkout_ad.jpg"/>
            </div>
            <div className="checkout_title">
                <h2>Your Basket Here</h2>

            </div>
            
        </div>
    )
}

export default Checkout
